import React from "react";
import logo from "./logo.svg";
import "./App.css";

/* import Header from './Header.js'; */

const App = () => {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src="https://i.pinimg.com/originals/b9/05/3d/b9053d873e9f69058997913e0fffca2e.png"></img>
      </header>
      <nav className="nav">
        <div><a>Profelis</a></div>
        <div><a>Message</a></div>
        <div><a>News</a></div>
        <div><a>Music</a></div>
        <div><a>Settings</a></div>
      </nav>
      <div className="content">
        <div>
        <img src = "https://mirpozitiva.ru/wp-content/uploads/2019/11/1476889932_zakat-derevo.jpg"></img>
        </div>
        <div>
          <img src = "https://klike.net/uploads/posts/2023-01/1674365337_3-31.jpg"></img>
        </div>
      </div>
    </div>
  );
};

export default App;
